SQLAlchemy简明教程 表的设计 常见操作 常见查询操作 常见删除操作 常见更新操作 常见插入操作 常见连表查询 数据库migration 原文可见: https://jiajunhuang.com/articles/2019_10_30-sqlalchemy.md.html SQLAlchemy是Python中常用的一个ORM，SQLAlchemy分成三部分： ORM，就是我们用类来表示数据库schema的那部分 SQLAlchemy Core，就是一些基础的操作，例如 update , insert 等等，也可以直接使用这部分来进行操作，但是它们写起来没有ORM那么自然 DBAPI，这部分就是数据库驱动 它们的关系如下(图片来自官网)： sqla arch 先来看看一个简单的例子： import contextlib
from sqlalchemy.ext.declarative import declarative_base
from sqlalchemy.orm import sessionmaker
from sqlalchemy import ( create_engine, Column, Integer, DateTime, String,
)
from config import config # config模块里有自己写的配置，我们可以换成别的，注意下面用到config的地方也要一起换 engine = create_engine( config.SQLALCHEMY_DATABASE_URI, # SQLAlchemy 数据库连接串，格式见下面 echo=bool(config.SQLALCHEMY_ECHO), # 是不是要把所执行的SQL打印出来，一般用于调试 pool_size=int(config.SQLALCHEMY_POOL_SIZE), # 连接池大小 max_overflow=int(config.SQLALCHEMY_POOL_MAX_SIZE), # 连接池最大的大小 pool_recycle=int(config.SQLALCHEMY_POOL_RECYCLE), # 多久时间主动回收连接，见下注释
)
Session = sessionmaker(bind=engine)
Base = declarative_base(engine) class BaseMixin: """model的基类,所有model都必须继承""" id = Column(Integer, primary_key=True) created_at = Column(DateTime, nullable=False, default=datetime.datetime.now) updated_at = Column(DateTime, nullable=False, default=datetime.datetime.now, onupdate=datetime.datetime.now, index=True) deleted_at = Column(DateTime) # 可以为空, 如果非空, 则为软删 @contextlib.contextmanager
def get_session(): s = Session() try: yield s s.commit() except Exception as e: s.rollback() raise e finally: s.close() class User(Base, BaseMixin): __tablename__ = "user" Name = Column(String(36), nullable=False) Phone = Column(String(36), nullable=False, unique=True) 注意上面的几点： pool_recycle : 设置主动回收连接的时长，如果不设置，那么可能会遇到数据库主动断开连接的问题，例如MySQL通常会为连接设置最大生命周期为八小时，如果没有通信，那么就会断开连接。因此不设置此选项可能就会遇到 MySQL has gone away 的报错。 engine : engine 是 SQLAlchemy 中位于数据库驱动之上的一个抽象概念，它适配了各种数据库驱动，提供了连接池等功能。其用法就是 如上面例子中，engine = create_engine(<数据库连接串>)，数据库连接串的格式是 dialect+driver://username:password@host:port/database?参数 这样的， dialect 可以是 mysql, postgresql, oracle, mssql, sqlite，后面的 driver 是驱动，比如MySQL的驱动pymysql， 如果不填写，就使用默认驱动。再往后就是用户名、密码、地址、端口、数据库、连接参数了，来看几个例子： MySQL : engine = create_engine('mysql+pymysql://scott:tiger@localhost/foo?charset=utf8mb4') PostgreSQL : engine = create_engine('postgresql+psycopg2://scott:tiger@localhost/mydatabase') Oracle : engine = create_engine('oracle+cx_oracle://scott:tiger@tnsname') MS SQL : engine = create_engine('mssql+pymssql://scott:tiger@hostname:port/dbname') SQLite : engine = create_engine('sqlite:////absolute/path/to/foo.db') 详见： https://docs.sqlalchemy.org/en/13/core/engines.html Session : Session的意思就是会话，也就是说，是一个逻辑组织的概念，因此，这需要靠你的业务逻辑来划分哪些操作使用同一个Session， 哪些操作又划分为不同的业务操作，详见 这里 。 举个简单的例子，以web应用为例，一个请求里共用一个Session就是一个好的例子，一个异步任务执行过程中使用一个Session也是一个例子。 但是注意，不能直接使用Session，而是使用 Session的实例 ，借助上面的代码，我们可以直接这样写： with get_session() as s: print(s.query(User).first()) Base : Base是ORM中的一个 基类 ，通过集成Base，我们才能方便的使用一些基本的查询，例如 s.query(User).filter_by(User.name="nick").first()。 BaseMixin : BaseMixin是定义的一些通用的表结构，通过Mixin的方式集成到类里，比如上面的定义，我们常见的表结构里，都会有 ID 、 创建时间 、 更新时间 ， 软删除标志 等等，我们把它作为一个独立的类，这样通过继承即可获得相关表属性，省得重复写多次。

